import { InputsI } from "../../models/Inputs";
import { margin } from "../../styles/Constants";
import { InputOrderBox } from "../../styles/Input";
import { InputTitleText } from "../../styles/TextStyles";
import { InputBase, InputButton, InputPopup } from "../Input";

export function setInputs(props: any) {
  const Input = ({ item }: any) => {
    switch (item.type) {
      case "popup":
        return null;
      case "text":
        return null;
      case "button":
        return null;
      default:
        return null;
    }
  };

  return props.data.map(({ item, index: any }) => (
    <InputOrderBox theme={{ marginY: margin.l }}>
      <InputTitleText>{item.title}</InputTitleText>
      <Input item={item} />
    </InputOrderBox>
  ));
}

export function setSingleInput(data: any, register: any) {
  const Input = ({ item }: any) => {
    switch (item.type) {
      case "popup":
        return <InputPopup register={register} data={item} />;
      case "text":
        return <InputBase register={register} data={item} />;
      case "button":
        return <InputButton register={register} data={item} />;
      default:
        return null;
    }
  };
  return (
    <InputOrderBox>
      <InputTitleText>{data.title}</InputTitleText>
      <Input item={data} />
    </InputOrderBox>
  );
}
